import React from 'react';

const Employe = ({props, ...rest}) => {
    return (
        <div>
            { console.log("component employer"),
            console.log(props) }
            <h3>Employé component</h3>
            <p> Entrez les informations concernant un employé</p>
            <p>Qui ses connecter</p>
            <p>puis parler également de d'autre choses plus interressants</p>
        </div>
    )
}


export default Employe;
